import MatchesList from "../components/MatchesList";

function MatchEnginePage() {
  return (
    <div className="space-y-6">
      <h1 className="text-2xl font-bold text-gray-800">AI Match Engine</h1>
      <p className="text-gray-600">
        Our AI-powered engine matches students with the best internship opportunities.
      </p>
      <MatchesList />
    </div>
  );
}

export default MatchEnginePage;
